import React from "react";
import "./FAQ.css";

const FAQ = () => {
  const faqs = [
    { question: "How do I reset my password?", answer: "Go to Forgot Password and follow instructions." },
    { question: "Can I change my email?", answer: "Yes, update it from your profile settings." },
  ];

  return (
    <div className="container">
      <h2>Frequently Asked Questions</h2>
      {faqs.map((faq, index) => (
        <div className="faq" key={index}>
          <h4>{faq.question}</h4>
          <p>{faq.answer}</p>
        </div>
      ))}
    </div>
  );
};

export default FAQ;
